import {useNavigate} from 'react-router-dom'
import logo from '../pics/logo192.png'

const HtIntro = () =>{
    const Navigate = useNavigate()
    const Hometown = () =>{
        Navigate('/hometown')
    }
    return <div>
        My introduction <button onClick={Hometown}>go hometown</button>
        </div>
    return <div>
        Hometown introduction
        <img src={logo} alt="logo"/>
        </div>
}
export default HtIntro;
